import React from 'react';

import EmergenciesList from './components/EmergenciesList';  // Correct path
import UsersList from './components/UsersList';  // Correct path

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Emergency Response Management System</h1>
      </header>
      <main>
        <EmergenciesList />
        <UsersList />
      </main>
    </div>
  );
}

export default App;
